import { Router, Routes, Route, Link } from 'react-router-dom';

export const Navbar = () => {
    return (
        <div>
            <Link to={"/"}> Home </Link>
            <br></br>
            <Link to={"/Completed"}> Completed </Link>
            <br></br>
            <Link to={"/Work"}> Work </Link>
        </div>
    );
}
